import { BrowserRouter,Switch,Route } from 'react-router-dom';
import './App.css';
import Header from './Components/Header/Header.js';
import Home from './Pages/Home/Home.js';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Header/>
        <Switch>
          <Route exact path='/'>
            <Home/>
          </Route>
          <Route>

          </Route>
      </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
